/**
 * Generate an inline SVG icon string.
 * Drop-in replacement for <span class="material-symbols-outlined">name</span>
 *
 * @param {string} name  - Icon name (key in ICON_PATHS)
 * @param {string} [cls] - Extra CSS class(es) to add, e.g. 'mi-sm mi-primary'
 * @param {number} [size] - Width/height in px (default 20, matches mi-inline)
 * @returns {string} HTML string of an inline <svg>
 */
export function svgIcon(name, cls = '', size = 20) {
  const d = ICON_PATHS[name];
  if (!d) {
    console.warn(`[svgIcon] Unknown icon: "${name}"`);
    return `<span class="svg-icon svg-icon--missing ${cls}" style="display:inline-block;width:${size}px;height:${size}px" title="${name}"></span>`;
  }
  return `<svg class="svg-icon${cls ? ' ' + cls : ''}" viewBox="0 0 24 24" width="${size}" height="${size}" fill="currentColor" aria-hidden="true"><path d="${d}"/></svg>`;
}

/**
 * Replace a live DOM element's material-symbols-outlined spans with inline SVGs.
 * Call once after inserting HTML that contains font icons.
 * @param {HTMLElement} root - Container to scan
 */
export function replaceMaterialIcons(root = document.body) {
  if (!root) return;
  const spans = [...root.querySelectorAll('.material-symbols-outlined')];
  // Also check root itself (MutationObserver passes addedNode directly)
  if (root.classList && root.classList.contains('material-symbols-outlined')) spans.unshift(root);
  spans.forEach(span => {
    const name = span.textContent.trim();
    const d = ICON_PATHS[name];
    if (!d) return;
    const size = span.classList.contains('mi-sm') ? 18
               : span.classList.contains('mi-xl') ? 32
               : span.classList.contains('mi-2xl') ? 40
               : 20;
    const svg = document.createElementNS('http://www.w3.org/2000/svg', 'svg');
    svg.setAttribute('viewBox', '0 0 24 24');
    svg.setAttribute('width', String(size));
    svg.setAttribute('height', String(size));
    svg.setAttribute('fill', 'currentColor');
    svg.setAttribute('aria-hidden', 'true');
    svg.classList.add('svg-icon');
    // Copy over styling classes (mi-primary, mi-error, etc.)
    span.classList.forEach(c => {
      if (c !== 'material-symbols-outlined' && c.startsWith('mi-')) svg.classList.add(c);
    });
    const path = document.createElementNS('http://www.w3.org/2000/svg', 'path');
    path.setAttribute('d', d);
    svg.appendChild(path);
    span.replaceWith(svg);
  });
}
